import './App.css';
import React from "react";
import {BrowserRouter as Router, Route, Switch, Redirect} from 'react-router-dom';

function App() {
  return (
    <Router history={history}>
        <Switch>
           <Redirect from="*" to="/" />
        </Switch>
      </Router>
  );
}

export default App;
